import React from 'react';

import style from './Navbar.module.css'

const Navbar = () => {
    return (
        <nav className={style.nav}>
            <ul>
                <li>
                    <a href="/Profile">Profile</a>
                </li>
                <li>
                    <a href="/Messages">Messages</a>
                </li>
                <li>
                    <a href="/News">News</a>
                </li>
                <li>
                    <a href="/Music">Music</a>
                </li>
                <li>
                    <a href="/Settings">Settings</a>
                </li>
            </ul>
        </nav>
    );
};

export default Navbar;
